// Compare old data to new data and build array with string list of changes for messaging
function diff(oldData, newData) {
  var changes = [];
  
  // Loop through all player names in the object
  Object.keys(newData).forEach( function(pName, index, array) {
    if (oldData[pName] != null) {
      
      // Loop through all toon/ship names in the player object
      Object.keys(newData[pName]).forEach( function(tName, index, array) {
        if (oldData[pName][tName] != null) {
          
          // Record improvements in output array
          if (newData[pName][tName]["rarity"] > oldData[pName][tName]["rarity"]) {
            changes.push(pName + 
                         " increased " + tName + 
                         "'s Star Level from " + parseInt(oldData[pName][tName]["rarity"]) + 
                         " to " + parseInt(newData[pName][tName]["rarity"]) + "!!!");
          }
          
          if (newData[pName][tName]["gear_level"] > oldData[pName][tName]["gear_level"]) {
            changes.push(pName + 
                         " increased " + tName + 
                         "'s Gear Level from " + parseInt(oldData[pName][tName]["gear_level"]) + 
                         " to " + parseInt(newData[pName][tName]["gear_level"]) + "!!!");
          }
        }
      });
    }
  });
  
  return changes;
};

